class AnnotatedParagraphSwitcher extends Presentation {
    constructor(functionInfo, userInterface, configuration) {
        super(functionInfo, userInterface, configuration);
        this.requestCounter = 0;
        this.annotations = [];
    }

    renderResult(request, result) {


        this.annotations = [];

        let ioRes = ioTypeUtils.toIOTypeInstance(result.result);

        if (ioRes.name === "Error") {

            alertManager.showErrorAlert(ioRes.message);

        } else if (ioRes.name === "NoResult") {
            alertManager.showErrorAlert(ioRes.message);
        } else if (ioRes.name === "AnnotatedParagraph") {

            if (request.input.type === Paragraph.className) {


                let requestID = this.createRequestId();
                let resultClass = this.getResultClass();
                let presentationIdentifier = this.getPresentationAndRequestIdentifier(requestID);

                let wikiClass = requestID + '-tooltip-wiki';

                for (let i = 0; i < ioRes.annotations.length; i++) {

                    if( ioRes.annotations[i].type = "wiki"){
                        if (this.insertAnnotation(ioRes.annotations[i])) {

                            ioRes.annotations[i].id = wikiClass + "-" + i;
                            ioRes.annotations[i].presentationHTML = '<span id="' + ioRes.annotations[i].id + '">' + ioRes.annotations[i].textToAnnotate + '</span>';
                        }
                    }


                }

                let presentationHTML = "";
                let curIndex = 0;
                for (let i = 0; i < this.annotations.length; i++) {

                    if (curIndex < this.annotations[i].position) {
                        presentationHTML += ioRes.paragraph.substring(curIndex, this.annotations[i].position);
                    }

                    presentationHTML += this.annotations[i].presentationHTML;

                    curIndex = this.annotations[i].position + this.annotations[i].textToAnnotate.length;

                }

                if (curIndex < ioRes.paragraph.length) {
                    presentationHTML += ioRes.paragraph.substring(curIndex);
                }

                //Render it
                for (let i = 0; i < request.input.textNodes.length; i++) {
                    $(request.input.textNodes[i]).wrap('<span class="' + resultClass + ' ' + requestID + ' er-ps-original-text" ' + presentationIdentifier + '></span>');
                }


                $('<span class="' + resultClass + ' ' + requestID + ' er-ps-replace-text" ' + presentationIdentifier + '>' + presentationHTML + '</span>').insertAfter($("." + requestID + ".er-ps-original-text").last());
                let button = $('<button class="' + resultClass + ' ' + requestID + '" ' + presentationIdentifier + ' style="width: 2em;height: 2em;padding: 0;border: 0;"><img src="' + this.configuration.remoteAssetDirectory + '/help-logo.png" style="width: 2em;height: 2em;"></button>');
                button.insertAfter($("." + requestID + ".er-ps-replace-text"));
                button.click(function () {
                    $("." + requestID + ".er-ps-original-text").toggle();
                    $("." + requestID + ".er-ps-replace-text").toggle();
                });
                $("." + requestID + ".er-ps-original-text").hide();


                //Create annotations
                for (let i = 0; i < this.annotations.length; i++) {
                    let currentAnnotation = this.annotations[i];
                    switch (this.annotations[i].type) {

                        case "wiki":
                            fetch(currentAnnotation.wikiLinks.summary)
                                .then(res => res.json())
                                .then((out) => {

                                    if (out.type !== "disambiguation" && out.description) {
                                        let popupHTML = "";
                                        if (out.thumbnail) {
                                            popupHTML = '<img src="' + out.thumbnail.source + '" alt="' + out.title + '"><br>';
                                        }
                                        popupHTML += out.description;

                                        tippy("#" + currentAnnotation.id, {
                                            content: popupHTML,
                                            animateFill: false,
                                            animation: 'fade',
                                            flipOnUpdate: true,
                                            theme: 'light-border',

                                        });
                                        $("#" + currentAnnotation.id).addClass("easy-reading-highlight");
                                    }



                                })
                                .catch(err => {
                                    throw err
                                });

                            break;

                        /*
                        tippy("#" + currentAnnotation.id, {
                            content: 'Loading...',
                            animateFill: false,
                            animation: 'fade',
                            flipOnUpdate: true,
                            onShow(instance) {
                                fetch(currentAnnotation.wikiLinks.summary)
                                    .then(res => res.json())
                                    .then((out) => {


                                        let popupHTML = "";
                                        if (out.thumbnail) {
                                            popupHTML = '<img src="' + out.thumbnail.source + '" alt="' + out.title + '"><br>';
                                        }
                                        popupHTML += out.description;


                                        instance.setContent(popupHTML)
                                    })
                                    .catch(err => {
                                        throw err
                                    });

                            },
                        });

                        break;*/

                    }
                }


            }
        }


    }


    insertAnnotation(annotation) {

        if (this.annotations.length === 0) {

            this.annotations.push(annotation);
            return true;
        } else {

            for (let i = 0; i < this.annotations.length; i++) {

                let start = this.annotations[i].position;
                let end = start + this.annotations[i].textToAnnotate.length;

                //Check overlap
                if (annotation.position === start) {

                    return false;
                }

                if (start < annotation.position && end > annotation.position) {

                    return false;
                }

                if (start < annotation.position + annotation.textToAnnotate.length && end > annotation.position + annotation.textToAnnotate.length) {

                    return false;
                }

            }


            for (let i = 0; i < this.annotations.length; i++) {

                if (this.annotations[i].position > annotation.position) {
                    this.annotations.splice(i, 0, annotation);
                    return true;

                }

            }
            this.annotations.push(annotation);
            return true;

        }

        return false;

    }

    undo() {

    }

    removeResult(requestID) {

        //Remove button
        $("button." + requestID).remove();
        //Remove replace text
        $("." + requestID + ".er-ps-replace-text").remove();

        let original = $("." + requestID + ".er-ps-original-text");
        let parent = original.last().parent();
        original.contents().unwrap();

        if (parent.length) {
            parent.get(0).normalize();
        }

    }
}
class AudioHighlighter extends Presentation {
    constructor(functionInfo, userInterface, configuration) {

        super(functionInfo, userInterface, configuration);

        this.audio = null;
        this.lastElement = null;
        this.wordSpeechMarks = null;
        this.wordTextMarker = null;
        this.sentenceTextMarker = null;
        this.sentenceSpeechMarks = [];
        this.isCompatibleWithOtherPresentations = true;
        this.instantDisplay = false;
    }

    renderResult(request, result) {

        let ioRes = ioTypeUtils.toIOTypeInstance(result.result);


        if (this.wordTextMarker) {
            this.wordTextMarker.remove();
        }
        if (this.sentenceTextMarker) {
            this.sentenceTextMarker.remove();
        }

        if (this.lastElement) {
            $(this.lastElement).removeClass("highlight-audio");
        }
        if (ioRes.name === "AudioType") {


            this.sentenceSpeechMarks = [];
            let sentences = [];
            for (let i = 0; i < ioRes.speechMarks.length; i++) {

                if (ioRes.speechMarks[i].type === "sentence") {

                    //AWS SPECIFIC STUFF
                    //Allow only unique starts. AWS sometimes produces more speechmarks with same start(e.g: 1845-1928 will return 3 speechmarks) this will confuse highlightning
                    if (this.sentenceSpeechMarks.length > 0) {
                        if (this.sentenceSpeechMarks[this.sentenceSpeechMarks.length - 1].start) {
                            if (this.sentenceSpeechMarks[this.sentenceSpeechMarks.length - 1].start === ioRes.speechMarks[i].start) {
                                continue;
                            }
                        }

                        if (this.sentenceSpeechMarks[this.sentenceSpeechMarks.length - 1].end) {
                            if (this.sentenceSpeechMarks[this.sentenceSpeechMarks.length - 1].end === ioRes.speechMarks[i].end) {
                                continue;
                            }
                        }
                    }


                    sentences.push(ioRes.speechMarks[i].value);
                    this.sentenceSpeechMarks.push(ioRes.speechMarks[i]);


                }
            }


            this.sentenceTextMarker = new TextMarker(request.input.textNodes, sentences, {
                highlightElementName: "span",
                highlightElementClass: "sentence-highlighter",
                backgroundColor: "#3ecfff",
                color: "inherit",

            });


            this.wordSpeechMarks = [];
            let words = [];
            for (let i = 0; i < ioRes.speechMarks.length; i++) {
                if (ioRes.speechMarks[i].type === "word") {

                    //AWS SPECIFIC STUFF
                    //Allow only unique starts. AWS sometimes produces more speechmarks with same start(e.g: 1845-1928 will return 3 speechmarks) this will confuse highlightning
                    if (this.wordSpeechMarks.length > 0) {

                        if (this.wordSpeechMarks[this.wordSpeechMarks.length - 1].start) {
                            if (this.wordSpeechMarks[this.wordSpeechMarks.length - 1].start === ioRes.speechMarks[i].start) {
                                continue;
                            }
                        }


                        if (this.wordSpeechMarks[this.wordSpeechMarks.length - 1].end) {
                            if (this.wordSpeechMarks[this.wordSpeechMarks.length - 1].end === ioRes.speechMarks[i].end) {
                                continue;
                            }
                        }


                    }

                    words.push(ioRes.speechMarks[i].value);
                    this.wordSpeechMarks.push(ioRes.speechMarks[i]);


                }
            }
            this.wordTextMarker = new TextMarker(request.input.textNodes, words);

            if (this.audio) {
                this.audio.pause();
                this.audio = null;
            }

            this.audio = new Audio(ioRes.mp3URL);
            if (this.configuration.speed) {
                if (this.configuration.speed === "slow") {
                    this.audio.playbackRate = 0.7;
                } else if (this.configuration.speed === "fast") {
                    this.audio.playbackRate = 1.3;
                }

            }

            //Disable highlighting because mark.js does not work properly

            let currentHighlightSentence = 0;
            let currentHighlightWord = 0;

            let audioHighlighter = this;
            this.audio.ontimeupdate = function () {
                if (currentHighlightSentence + 1 < audioHighlighter.sentenceSpeechMarks.length) {

                    if (audioHighlighter.sentenceSpeechMarks[currentHighlightSentence + 1].time < audioHighlighter.audio.currentTime * 1000) {
                        currentHighlightSentence++;
                        audioHighlighter.sentenceTextMarker.markNext();

                    }

                }

                if (currentHighlightWord + 1 < audioHighlighter.wordSpeechMarks.length) {


                    if (audioHighlighter.wordSpeechMarks[currentHighlightWord + 1].time < audioHighlighter.audio.currentTime * 1000) {
                        currentHighlightWord++;
                        audioHighlighter.wordTextMarker.markNext();

                    }

                }

            };
            this.sentenceTextMarker.markNext();
            this.wordTextMarker.markNext();

            this.audio.play();
            this.audio.onended = function () {

                if (audioHighlighter.wordTextMarker) {
                    audioHighlighter.wordTextMarker.remove();
                }
                if (audioHighlighter.sentenceTextMarker) {
                    audioHighlighter.sentenceTextMarker.remove();
                }

                if (audioHighlighter.lastElement) {
                    $(audioHighlighter.lastElement).removeClass("highlight-audio");
                }
                globalEventListener.presentationFinished(audioHighlighter);
            };

        } else if (ioRes.name === "Error") {

            alertManager.showErrorAlert(ioRes.message);

        } else if (ioRes.name === "NoResult") {
            alertManager.showErrorAlert(ioRes.message);
        }


    }

    removeResult(requestID) {

        if (this.wordTextMarker) {
            this.wordTextMarker.remove();
        }
        if (this.sentenceTextMarker) {
            this.sentenceTextMarker.remove();
        }


        if (this.audio) {
            this.audio.pause();
            this.audio.ontimeupdate = null;
            this.audio.onended = null;
            this.audio = null;
        }
    }

    removeAnimatedResult() {
        this.removeResult();
    }

    undo() {

    }
}

class ContentReplacementSwitcher extends Presentation {
    constructor(functionInfo, userInterface, configuration) {
        super(functionInfo, userInterface, configuration);
        this.requestCounter = 0;
        this.currentRequestID = null;
        this.replacements = [];
    }

    renderResult(request, result) {

        if(this.currentRequestID){
            this.removeResult();
        }

        let ioRes = ioTypeUtils.toIOTypeInstance(result.result);
        if (ioRes.name === "Error") {
            alertManager.showErrorAlert(ioRes.message);

        } else if (ioRes.name === "NoResult") {

            if(!result.requestInfo.automaticRequest){
                alertManager.showInfoAlert(ioRes.message);
            }
        } else if (ioRes.name === "ContentReplacement") {

            if(ioRes.replacements.length > 0){
                let requestID = this.createRequestId();
                let resultClass = this.getResultClass();
                let presentationIdentifier = this.getPresentationAndRequestIdentifier(requestID);

                this.replacements = ioRes.replacements;
                this.currentRequestID = requestID;


                for(let i=0; i  < ioRes.replacements.length; i++){


                    if(ioRes.replacements[i].type === "content_replacement"){

                        try{
                            let replacementID = "replacement-" + i + "-" + ioRes.replacements[i].replacement.id;

                            ioRes.replacements[i].replacementID = replacementID;
                            let elementToReplace = $(ioRes.replacements[i].replacement.selector);

                            //We dont use tag name any more..... tag could be a span or a p and then headings and other p will break dom....
                            let tagName = $(ioRes.replacements[i].replacement.selector).prop("tagName").toLowerCase();
                            let originalClasses = $(ioRes.replacements[i].replacement.selector).attr('class');

                            $(elementToReplace).addClass(replacementID + ' er-crs-original-text er-content-replacement');



                            let rules = getMatchedCSSRules(elementToReplace[0]);
                            let combinedStyles = "";
                            for (let i = 0; i < rules.length; i++) {
                                combinedStyles += rules[i].style.cssText;
                            }

                            //Todo ... looki into this again
                            combinedStyles = "";

                            let html = '<span class="er-content-replacement er-content-replacement-ui"><span><span class="er-toggle-button  ' + replacementID + ' role="button" tabindex="0" aria-pressed="false" aria-label="Switch to simple version" >\n' +
                                '    <span class="er-toggle-button-inner">\n' +
                                '        <span class="er-toggle-button-front">\n' +
                                '           <img src="'+this.configuration.remoteAssetDirectory+'/help-logo.png" alt="">\n' +
                                '        </span>\n' +
                                '        <span class="er-toggle-button-back">\n' +
                                '              <img src="'+this.configuration.remoteAssetDirectory+'/original-logo.png" alt="">\n' +
                                '        </span>\n' +
                                '    </span>\n' +
                                '</span></span></span>';



                            $('<div class="' + replacementID + ' er-crs-replace-text er-content-replacement" style="' + combinedStyles + '">'+html + ioRes.replacements[i].replacement.replacement + '</div>').insertAfter($("." + replacementID + ".er-crs-original-text").last());


                            $("." + replacementID + ".er-crs-replace-text").addClass(originalClasses);

                            $("." + replacementID + ".er-crs-replace-text").hide();



                            $(html).prependTo($(elementToReplace));
                            //$(html).insertBefore($(elementToReplace));

                            $(".er-toggle-button." + replacementID).click(function () {
                                toggleButton(replacementID);
                            }).keydown(function (e) {
                                if (e.key === " " || e.key === "Enter") {
                                    toggleButton(replacementID);
                                }
                            });

                            function toggleButton(replacementID) {
                                $("." + replacementID + ".er-crs-original-text").toggle();
                                $("." + replacementID + ".er-crs-replace-text").toggle();
                                $("." + replacementID + ".er-crs-replace-text .er-toggle-button-inner").toggleClass("active");
                                let flipButton = $("." + replacementID + ".er-toggle-button");
                                if (flipButton.attr("aria-pressed") === "true") {
                                    flipButton.attr("aria-pressed", "false");
                                } else {
                                    flipButton.attr("aria-pressed", "true");
                                }


                            }

                            window.setInterval(function () {
                                $("."+replacementID).toggleClass("animation-active");
                            }, 1000);
                        }catch (e) {

                            console.log(e);
                        }

                    }

                }


            }



        }

        globalEventListener.presentationFinished(this);


    }

    undo() {

    }

    remove(){
        this.removeLastResult();
    }

    removeLastResult(){
        console.log(this.replacements);
        for (let i = 0; i < this.replacements.length; i++) {
            $("." + this.replacements[i].replacementID + ".er-crs-original-text .er-content-replacement-ui").remove();
            $("." + this.replacements[i].replacementID + ".er-crs-original-text").show().removeClass( [ "er-crs-original-text", "er-content-replacement"]);
            $("." + this.replacements[i].replacementID + ".er-crs-replace-text").remove();

        }
        this.replacements = [];
    }

    removeResult(requestID) {
        this.removeLastResult();
    }
}



