class TippyTooltip extends Presentation {
    constructor(functionInfo, userInterface, configuration) {
        super(functionInfo, userInterface, configuration);

    }

    renderResult(request, result) {

        let ioRes = ioTypeUtils.toIOTypeInstance(result.result);
        let resultHTML = ioRes.toHtml();
        let requestID = this.createRequestId();

        if (request.inputType instanceof Word) {



            //let className = "easy-reading-tippy-tooltip-"+this.requestCounter;
            //pageUtils.wrapWordIn(request.input, "span",this.createRequestId(),"easy-reading-result easy-reading-tippy-tooltip "+className);

            let span = pageUtils.wrapWordIn(request.input, "span", requestID+" easy-reading-tippy-tooltip " + this.getResultClass(), this.getPresentationAndRequestIdentifier(requestID));

            if (ioRes instanceof ImageIOType) {
                const INITIAL_CONTENT = 'Loading...';

                const state = {
                    isFetching: false,
                    canFetch: true
                };

                tippy("." + requestID, {
                    content: INITIAL_CONTENT,
                    theme: 'light-border',
                    async onShow(tip) {
                        if (state.isFetching || !state.canFetch) return;

                        state.isFetching = true;
                        state.canFetch = false;

                        try {


                            let downloadingImage = new Image();
                            downloadingImage.onload = function () {
                                if (tip.state.isVisible) {
                                    this.width = 100;
                                    tip.setContent(this)
                                }
                            };
                            downloadingImage.src = result.result.url;

                        } catch (e) {
                            tip.setContent(`Fetch failed. ${e}`)
                        } finally {
                            state.isFetching = false
                        }
                    },
                    onHidden(tip) {

                    }
                });

            } else {
                tippy("." + requestID, {
                    content: resultHTML,
                    theme: 'light-border',
                });
            }

        } else if (request.inputType instanceof Paragraph) {

            let div = $( request.input.element).wrap( "<div class='"+ requestID+" easy-reading-tippy-tooltip "+this.getResultClass()+"' "+this.getPresentationAndRequestIdentifier(requestID)+"></div>" );

            tippy("." + requestID, {
                content: resultHTML,
                theme: 'light-border',
            });

        }

        globalEventListener.presentationFinished(this);

    }

    undo() {

    }
    removeResult(requestID){

        const tooltipElement = $("."+requestID);
        if(tooltipElement.length){
            const instance = tippy(tooltipElement[0]);
            if(instance){
                instance.destroy(true);
            }else{
                if(tooltipElement[0]._tippy){
                    tooltipElement[0]._tippy.destroy(true);
                }
            }

            let parent = tooltipElement.parent();
            tooltipElement.contents().unwrap();
            if(parent.length){
                parent.get(0).normalize();
            }
        }

    }


}
class SpinnerBusyAnimation extends BusyAnimation{

    constructor(configuration){
        super(configuration);

        this.numberOfBusyRequests = 0;

        $("body").append('<div id="er-busy-animation" style="display: none" class="lds-ring"><div></div><div></div><div></div><div></div></div>');
        $(document).on('mousemove', function(e){
            $('#er-busy-animation').css({
                left:  e.pageX-30,
                top:   e.pageY+20
            });
        });
    }


    startAnimation(textnodes){
        this.numberOfBusyRequests++;
        $('#er-busy-animation').show();

    }

    stopAnimation(){
        this.numberOfBusyRequests--;
        $('#er-busy-animation').hide();

    }
}


let easyReadingColorizeEnabled = false;
function colorize(req, config,widget) {

    $("#easy-reading-colorize-style").remove();
    $("<style id='easy-reading-colorize-style' type='text/css'> .easyReaderColorize{ color:"+config.fontColor+" !important; background-color:"+config.backgroundColor+" !important;} </style>").appendTo("head");

    if(easyReadingColorizeEnabled){
        $("*").removeClass("easyReaderColorize");
    }else{
        $("*").each(function () {

            if(!$(this).parents('.easy-reading-interface').length && ! $(this).hasClass('easy-reading-interface')){

                if(!$(this).is("img")){
                    $(this).addClass("easyReaderColorize");
                }


            }
        });


    }

    easyReadingColorizeEnabled = !easyReadingColorizeEnabled;
}

let zoom = 0;
let zoomInit = false;

function initFontMagnification() {
    if (!zoomInit) {
        $('*').each(function () {
            let el = $(this);
            let size = parseInt(el.css('font-size'));
            el.data('font-size', size);


        });
        zoomInit = true;
    }

}

function magnifyFont(req, config,widget) {
    initFontMagnification();
    zoom++;
    $('*').each(function () {
        if(!$(this).parents('.easy-reading-interface').length){
            let el = $(this);
            let size = el.data('font-size');
            el.css('font-size', Math.max(size + zoom, 0) + 'px');
        }

    });


}

function shrinkFont(req, config) {
    initFontMagnification();
    zoom--;
    $('*').each(function () {
        if(!$(this).parents('.easy-reading-interface').length){
            let el = $(this);
            let size = el.data('font-size');
            el.css('font-size', Math.max(size + zoom, 0) + 'px');
        }

    });
}

///LINE HEIGHT
let lineHeight = 0;
let lineHeightInit = false;

function initLineHeight() {
    if (!lineHeightInit) {
        $('*').each(function () {
            let el = $(this);
            let size = parseInt(el.css('line-height'));
            console.log(size);
            el.data('line-height', size);

        });
        lineHeightInit = true;
    }

}

function increaseLineHeight(req, config) {
    initLineHeight();
    lineHeight++;
    $('*').each(function () {
        if(!$(this).parents('.easy-reading-interface').length){
            let el = $(this);
            let size = el.data('line-height');
            el.css('line-height', Math.max(size + lineHeight, 0) + 'px');
        }

    });


}
function decreaseLineHeight(req, config) {
    initLineHeight();
    lineHeight--;
    $('*').each(function () {
        if(!$(this).parents('.easy-reading-interface').length){
            let el = $(this);
            let size = el.data('line-height');
            el.css('line-height', Math.max(size + lineHeight, 0) + 'px');
        }

    });
}
