var REGEXPS = {
    // NOTE: These two regular expressions are duplicated in
    // Readability.js. Please keep both copies in sync.
    unlikelyCandidates: /-ad-|ai2html|banner|breadcrumbs|combx|comment|community|cover-wrap|disqus|extra|footer|gdpr|header|legends|menu|related|remark|replies|rss|shoutbox|sidebar|skyscraper|social|sponsor|supplemental|ad-break|agegate|pagination|pager|popup|yom-remote/i,
    okMaybeItsACandidate: /and|article|body|column|main|shadow/i,
};

function isNodeVisible(node) {
    // Have to null-check node.style to deal with SVG and MathML nodes.
    return (!node.style || node.style.display != "none") && !node.hasAttribute("hidden")
        && (!node.hasAttribute("aria-hidden") || node.getAttribute("aria-hidden") != "true");
}

/**
 * Decides whether or not the document is reader-able without parsing the whole thing.
 *
 * @return boolean Whether or not we suspect Readability.parse() will suceeed at returning an article object.
 */
function isProbablyReaderable(doc, isVisible) {
    if (!isVisible) {
        isVisible = isNodeVisible;
    }

    var nodes = doc.querySelectorAll("p, pre");

    // Get <div> nodes which have <br> node(s) and append them into the `nodes` variable.
    // Some articles' DOM structures might look like
    // <div>
    //   Sentences<br>
    //   <br>
    //   Sentences<br>
    // </div>
    var brNodes = doc.querySelectorAll("div > br");
    if (brNodes.length) {
        var set = new Set(nodes);
        [].forEach.call(brNodes, function(node) {
            set.add(node.parentNode);
        });
        nodes = Array.from(set);
    }

    var score = 0;
    // This is a little cheeky, we use the accumulator 'score' to decide what to return from
    // this callback:
    return [].some.call(nodes, function(node) {
        if (!isVisible(node))
            return false;

        var matchString = node.className + " " + node.id;
        if (REGEXPS.unlikelyCandidates.test(matchString) &&
            !REGEXPS.okMaybeItsACandidate.test(matchString)) {
            return false;
        }

        if (node.matches("li p")) {
            return false;
        }

        var textContentLength = node.textContent.trim().length;
        if (textContentLength < 140) {
            return false;
        }

        score += Math.sqrt(textContentLength - 140);

        //Old value was 20
        if (score > 30) {
            return true;
        }
        return false;
    });
}let erReadabilityActive = false;

function readability(req, config,widget) {

    config = {
        contentWidth: 50,
        fontSize: 24,
        lineSpacing: 2.5,
    };

    if(erReadabilityActive){

        $(".er-readability-hidden").removeClass("er-readability-hidden");
        $("#er-readability-container").remove();
        $("body").removeClass("er-readability-body");
    }else{
        let sentenceTokenizer = new SentenceTokenizer();
        if(isProbablyReaderable(document)){

            let options = {
                "newline_boundaries" : false,
                "html_boundaries"    : false,
                "sanitize"           : false,
                "allowed_tags"       : false,
                "preserve_whitespace" : true,
                "abbreviations"      : null
            };
            let documentClone = document.cloneNode(true);
            let article = new Readability(documentClone).parse();


            let title = "<h1>"+article.title+"</h1>";
            let readabilityContent = $.parseHTML(title+article.content);

            let container = $.parseHTML("<div class='er-readability-background'>" +
                "   <div class='er-readability-container' id='er-readability-container'>" +
                "   </div>" +
                "</div>");
            $('body').append(container);
            $('#er-readability-container').append(readabilityContent);


            $('#er-readability-container *:empty' ).each(function () {
                if($(this).is("img")){

                }else{
                    $(this).remove();
                }
            });


            let whitelist = ["src","alt","title","href","colspan","rowspan","scope","lang"];
            $('#er-readability-container *').each(function() {
                var attributes = this.attributes;
                var i = attributes.length;
                while( i-- ) {
                    var attr = attributes[i];
                    if( $.inArray(attr.name,whitelist) == -1 )
                        this.removeAttributeNode(attr);
                }
            });

            $('#er-readability-container p').each(function () {

                let html = $(this).html();
                let sentences = er_tokenizer.sentences(html,options);
                let sentencesWithBR = "";
                for(let i=0; i < sentences.length; i++){

                    sentencesWithBR+=sentences[i];
                    if(i < sentences.length-1){
                        sentencesWithBR+="<br>";
                    }
                }
                $(this).html(sentencesWithBR);
            });
            $('body').children().each(function () {

                if($(this).hasClass("easy-reading-interface") || $(this).hasClass("er-readability-background")){

                }else{
                    $(this).addClass('er-readability-hidden');
                }
            });

            $("body").addClass("er-readability-body");
            $('#er-readability-container *').addClass("er-readability-style-revert");

            $(".er-readability-container").css("max-width", config.contentWidth+"%");
            $(".er-readability-container").css("font-size", config.fontSize);
            $(".er-readability-container").css("line-height", config.lineSpacing);

        }else{
            alertManager.showErrorAlert("Sorry I could not detect the content of the page.");

            widget.requestFailed(req,config);
        }


    }

    erReadabilityActive = !erReadabilityActive;





}
let easyReadingScreenRulerVisible = false;
let easyReadingScreenRulerCurrentClientY = 0;

function easyReadingScreenRuler(req, config,widget) {

    if(easyReadingScreenRulerVisible){
        hideEasyReadingScreenRuler();
    }else{
        showEasyReadingScreenRuler();
    }
    easyReadingScreenRulerVisible = !easyReadingScreenRulerVisible;
}

let listener = function(event){
    if(easyReadingScreenRulerVisible){
        $("#overlay-top").css("bottom", $(window).height() -event.clientY +20);
        $("#overlay-bottom").css("top", event.clientY +20);
    }

    easyReadingScreenRulerCurrentClientY = event.clientY;
};

function showEasyReadingScreenRuler() {

    $('body').append('<div id="overlay-top"></div><div id="overlay-bottom"></div>');
    $("#overlay-top").css("bottom", $(window).height() -easyReadingScreenRulerCurrentClientY +20);
    $("#overlay-bottom").css("top",easyReadingScreenRulerCurrentClientY +20);
}

function hideEasyReadingScreenRuler(){
    $("#overlay-top").remove();
    $("#overlay-bottom").remove();
}
let easyReadingScreenRulerDocumentReady = $(document).ready(function () {
    $(document).mousemove(listener);
});


